import React, { Component, Profiler } from 'react'
import './MyProfile.css';

const MyProfile = ({ users }) =>{

  

    findCurrentEmail = (id,users) => {
        let email;
        users.forEach(user => {
            if(user.id == id) {
                email = user.email;
            }
        })

        return email;
    }


    return (
      <div className='MyProfile'>
          <h2>My Profile</h2>
          <span>Email - {findCurrentEmail(id,users)}</span>
      </div>
    )
  }

export default MyProfile;
